import React from "react";
import { NavLink } from "react-router-dom";
import logo from "../logo.svg";

const Navbar = () => {
    const isEmployee = localStorage.getItem("jwt");  // Check for JWT token

    return (
        <nav className="navbar navbar-expand-lg navbar-dark bg-dark">
            <NavLink className="navbar-brand" to="/">
                <img src={logo} alt="Logo" style={{ width: '40px', marginRight: '10px' }} />
                Bank Portal
            </NavLink>
            <button className="navbar-toggler" type="button" data-toggle="collapse" data-target="#navbarNav" aria-controls="navbarNav" aria-expanded="false" aria-label="Toggle navigation">
                <span className="navbar-toggler-icon"></span>
            </button>
            <div className="collapse navbar-collapse" id="navbarNav">
                <ul className="navbar-nav ml-auto">
                    <li className="nav-item"><NavLink className="nav-link" to="/login">Login</NavLink></li>
                    <li className="nav-item"><NavLink className="nav-link" to="/register">Register</NavLink></li>
                    <li className="nav-item"><NavLink className="nav-link" to="/pay">Payment</NavLink></li>
                    {isEmployee && (
                        <li className="nav-item">
                            <NavLink className="nav-link" to="/portal">International Payment Portal</NavLink>
                        </li>
                    )}
                </ul>
            </div>
        </nav>
    );
};

export default Navbar;
